  false,\n\t\"url\": null,\n\t\"notes\": \"D'Agnese and others (1998) developed a
  potentiometric surface to conceptualize the regional ground-water flow system and
  to construct numerical flow models of the Death Valley region, Nevada and California.
  The estimated potentiometric surface was derived using a gridding algorithm and
  interactive editing to produce contours representative of the natural water-table
  conditions. Input data included the altitudes of lakes, springs, and wetlands; water-level
  data from wells; and hydrogeologic information pertaining to areas of recharge,
  discharge, and low- permeability rocks\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
